import React from "react";
import { TodoCounter } from '../TodoCounter';
import { TodoSearch } from '../TodoSearch';
import { TodoList } from '../TodoList';
import { TodoItem } from '../TodoItem';
import { CreateTodoButton } from '../CreateTodoButton';

function TodoPopUi({
    totalTodos,
    completedTodos,
    searchValue,
    setSearchValue,
    searchedTodos,
    onComplete, 
}){
    return (
        <React.Fragment>
		    <section className="TodoBox">
            <section className="TodoBox--marc"></section>
        <TodoCounter/>
        <TodoSearch/>
        <CreateTodoButton/>
        <TodoList>
          {searchedTodos.map(todo => (
            <TodoItem key={todo.text} text={todo.text} value={todo.value} progress={todo.progress} completed={todo.completed} />
            ))}
        </TodoList>
    	</section>
    	</React.Fragment>
    );
}
export { TodoPopUi };
